import React, { useState, useEffect } from 'react';
import ReactPaginate from 'react-paginate';

const AgentDetails = () => {
  const [data, setData] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [currentPage, setCurrentPage] = useState(0);
  const itemsPerPage = 10;

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch('http://127.0.0.1:5500/agent_details.json');
      const responseData = await response.json();
      setData(responseData);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  // Helper function to generate highlighted text
  const highlightText = (text, query) => {
    const regex = new RegExp(`(${query})`, 'gi');
    return text.split(regex).map((part, index) =>
      regex.test(part) ? (
        <mark key={index}>{part}</mark>
      ) : (
        <span key={index}>{part}</span>
      )
    );
  };

  const filteredItems = data.filter((item) =>
    Object.values(item).some(
      (value) =>
        value &&
        value.toString().toLowerCase().includes(searchQuery.toLowerCase())
    )
  );

  const pageCount = Math.ceil(filteredItems.length / itemsPerPage);
  const currentItems = filteredItems.slice(
    currentPage * itemsPerPage,
    (currentPage + 1) * itemsPerPage
  );

  const handlePageClick = ({ selected }) => {
    setCurrentPage(selected);
  };

  return (
    <>
      <p className='ps-5'>
        <b>Pages</b>/Wazuh
      </p>
      <div className='inline-block ' style={{ marginLeft: '500px' }}>
        <div className='form'>
          <div
            className='input-group w-50 pt-2 ms-auto'
            style={{
              marginRight: '65px',
              marginBottom: '25px',
              marginTop: '-20px',
            }}
          >
            <input
              type='text'
              className='form-control'
              style={{
                background: '#fafaff',
                color: 'black',
                fontWeight: '500',
              }}
              placeholder='Search'
              id='searchbar'
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <button
              type='submit'
              className='input-group-text'
              id='search-icon'
              style={{ background: 'rgba(46, 83, 218, 0.826)' }}
            >
              <svg
                xmlns='http://www.w3.org/2000/svg'
                width='16'
                height='16'
                fill='white'
                className='bi bi-search'
                viewBox='0 0 16 16'
              >
                <path
                  d='M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0'
                />
              </svg>
            </button>
          </div>
        </div>
      </div>

      <table className='table ms-5'>
        <thead>
          <tr>
            <th>S.No</th>
            <th>OS</th>
            <th>Agent Name</th>
            <th>IP</th>
            <th className=''>Date</th>
            <th className=''>Time</th>
            <th className=''>Status</th>
          </tr>
        </thead>
        <tbody>
          {currentItems.map((item, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{highlightText(item.os_name, searchQuery)}</td>
              <td>{highlightText(item.agent_name, searchQuery)}</td>
              <td>{highlightText(item.registerIp, searchQuery)}</td>
              <td className=''>{highlightText(item.dateAdd, searchQuery)}</td>
              <td className=''>{highlightText(item.time, searchQuery)}</td>
              <td className='status'>
                {item.os_name.toLowerCase().includes('windows')
                  ? 'Active'
                  : 'Disconnected'}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className='pagination-container'>
        <ReactPaginate
          previousLabel={'previous'}
          nextLabel={'next'}
          breakLabel={'...'}
          pageCount={pageCount}
          marginPagesDisplayed={2}
          pageRangeDisplayed={5}
          onPageChange={handlePageClick}
          containerClassName={'pagination'}
          subContainerClassName={'pages pagination'}
          activeClassName={'active'}
        />
      </div>
    </>
  );
};

export default AgentDetails;
